  selector: 'app-vrinfo',
  templateUrl: './vrinfo.component.html',
  styleUrls: ['./vrinfo.component.css'],
  encapsulation: ViewEncapsulation.None  // This line is optional if you want styles to be global
})
export class VRInfoComponent implements OnInit {

  headsetsList = HEADSETS; 

  ngOnInit(): void {
  }

  sendOSC() {
    fetch("http://localhost:3000/VRHeadsets");
    //http://localhost:3000/DownloadAssets/VR1
